description:
Lights of the theatre dim and the cave fades into palpable darkness. The maiden dances, her movements sending waves of light pulsing through caged roof and walls of the theatre stage structure. She dances, and her movements are a fragile but natural extension of her surroundings, fading into the landscape of the cave.

Soundscape created by PAN BONKA

{2020 — chapter 2 of 3}
